import React, { useState } from 'react';
import Modal from "react-bootstrap/Modal";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useHistory
} from "react-router-dom";
import '../../Utils/css/style.css';
import '../../Utils/css/responsive.css';
import "../../Utils/css/bootstrap.min.css"
import "../../Utils/css/bootstrap-datepicker.css"
import modalClose from "../../images/modal-close.png"


function LoginComponents(props) {
  return (
    <>
          {/* <Modal class="modal" id="myModallogin" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true" show={true}> */}
            <Modal class="modal" id="myModallogin" role="dialog" aria-hidden="true" show={true}>
              <div class="modal-dialog custom-modal">
                <div class="modal-content">

                  {/* <!-- Modal Header --> */}
                  <div class="modal-header">
                    <h4 class="modal-title">Login</h4>
                    <button type="button" class="close" data-dismiss="modal">
                      <img src={modalClose} alt="" />
                    </button>
                  </div>

                  {/* <!-- Modal body --> */}
                  <div class="modal-body">
                    <form>
                      <div class="form-group">
                        <label>Email</label>
                        <input type="email" class="form-control" />
                      </div>
                      <div class="form-group">
                        <label>Password</label>
                        <input type="password" class="form-control" />
                      </div>
                      <div class="btn-set">
                        <button type="submit" class="btn btn-deflt">Submit</button>
                      </div>
                    </form>
                  </div>
                </div>
              </div>
            </Modal>
          {/* </Modal> */}
    </>
  );
}

export default LoginComponents;
